<body> 
 
  <header>
  </header>

<div>
    <h1 id = "clock">
      00:00:00   
    </h1>
</div>

<p id="day">Nap</p>
<p id="hour">Óra</p>
<p id="minute">Perc</p>
<p id="sec">Másodperc</p>
    
    
  <script>
    var endDate = new Date("2024-04-14T05:00:00"); //ez az az időpont, amíg számol

    function updateCountdown() //ez beállítja a html elem szövegét (konkrétan, hogy mi van kiírva, jelen esetben az adott óra:perc:másodperc)
    {
      var now = new Date();

      var timeRemaining = endDate - now;

      if (timeRemaining <= 0) 
      {
        document.getElementById("clock").innerHTML = "Vége";
      } 

      else 
      {
        var days = Math.floor(timeRemaining / (1000*60*60*24));
        var hours = Math.floor((timeRemaining % (1000 * 60 * 60 * 24)) / (1000*60*60));  //itt azért szorzom ezekkel, mert alapból millisecondbann kapom meg a hátralévő idő értéték és ugye először felszorzom másodpercre, aztán percre, aztán órára), nyilván lehetne simán csak 36000 is, csak így átláthatódd és kevésbé rontom el.
        var minutes = Math.floor((timeRemaining % (1000 * 60 * 60)) / (1000 * 60)); //ez ugye először megnézi, hogy a fennmaradó időnek mennyi millisecond a perc része (tehát amiből nem jön ki egy teljes óra), azán azt leosztom perccé.
        var seconds = Math.floor((timeRemaining % (1000 * 60)) / 1000); //itt ugyanez, csak másodpercben.

        hours = hours < 10 ? "0" + hours : hours;   //ezek csak annyit csinálnak, hogy a számok elé tesznek egy nullát, hogy ne úgy legyen kiírva, hogy 8:5:32, hanem 08:05:32
        minutes = minutes < 10 ? "0" + minutes : minutes;
        seconds = seconds < 10 ? "0" + seconds : seconds;

        var timeString = days + ":" + hours + ":" + minutes + ":" + seconds;

        document.getElementById("clock").innerHTML = timeString;  //itt állítom át a html felirat konkrét értékét (hogy mit írjon ki)
      }
    }

    setInterval(updateCountdown, 1000);  //ez beépített függvény és azt állítja be, hogy másodpercenként ismétlődjön a függvény.

    updateCountdown();  //ez csak azért van itt, hogy amikor elindítom egyből az óra legyen kiírva, mert különben 00:00:00-t mutatna az első másodpercben (az első frissítésig)
  </script>

</body>
